import React from "react";
// import { useState,useEffect } from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    return (
       <div>
        <h3>Twitter scams.....</h3>
        <br/>
        <br/>
        {
            Tweet.map(tweet =>{
                return(
                    <div className="box" key ={tweet.id}>
                        <strong>{tweet.name}</strong> <br></br> <br></br>
                        {tweet.totaltweet}<br></br>
                        </div>
                )
            })
        }
       </div> 
       );
}

 export default Twitter;










